import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './PhoneIdentification.css';
import './AttractLoop.css';
import Header from './Header';
import DialPad from './DialPad';



class PhoneNumberIdentification extends Component{
    constructor(props){
        super(props);
        this.state = {
            phoneNumber: '',
            defaultMessage:'Enter the Phone number associated with the account',
        };
    }
    setErrorMessage = () => {
        this.setState({defaultMessage:"Not a valid mobile number Please re enter"});
    };
    handleTheKeyClicks = e => {

        const clickedValue = e.target.innerText.trim() ;

        if(!clickedValue ){
            alert("Passed nothing");
        }
        else{
            const prev = this.state.phoneNumber;

            this.setState({
                phoneNumber:prev+clickedValue
            })

        }
    };

    checkPhoneNumber = () => {
        this.state.phoneNumber.trim().length == 10 && this.state.phoneNumber? this.props.history.push(`/`):this.setErrorMessage()
    };
    render(){

        return(
            <div>
                <Header />
                <DialPad />  
            </div>
        );
    };

}


export default PhoneNumberIdentification;
PhoneNumberIdentification.propTypes = {


    history: PropTypes.shape({
      push: PropTypes.func,
    }).isRequired,
  };
